import { loadSharedConfigFiles } from "@smithy/shared-ini-file-loader/dist-cjs/loadSharedConfigFiles";
import { mergeConfigFiles } from "@smithy/shared-ini-file-loader/dist-cjs/mergeConfigFiles";
export const parseKnownFiles = async (init) => {
    const parsedFiles = await loadSharedConfigFiles(init);
    return mergeConfigFiles(parsedFiles.configFile, parsedFiles.credentialsFile);
};
